import React from 'react'
import { Menu } from 'semantic-ui-react'


class NavigationBar extends React.Component {
   items = [
    { key: 'About', active: true, name: 'Editorials' },
    { key: 'Events', name: 'Reviews' },
    { key: 'Contact', name: 'Upcoming Events' },
    { key: 'Student Resources', name: 'Upcoming Events' },
    { key: 'Partner with Pratt', name: 'Upcoming Events' },
  ];


  render() {
    return(
      <Menu items = {items}/>
    );
  }



}

export default NavigationBar
